import React, {Component} from "react";
import "../Css/MapMarker.css"

function MapMarker (props) {
    return(
        <Marker latitude={props.lat} longt={props.lng}  offsetLeft={-20} offsetTop={-10}>
                <div className="MapMarker">
                    <h1>{props.title}</h1>
                </div>
        </Marker> 

    )
}

export default MapMarker;
